Силиконовая шапочка Mad Wave Reverse CHAMPION - это двухсторонняя шапочка, которая отлично подойдет как женщинам, так и мужчинам. Такую шапочку можно надевать под разные купальники, всего лишь вывернув и надев ее другой стороной.
ОСОБЕННОСТИ:
100% силикон - обеспечивает высокую эластичность, не пропускает воду, плотно облегает голову;
Двухсторонняя силиконовая шапочка - совмещает в себе две шапочки разных цветов;
Универсальный размер - подходит как взрослым, так и подросткам;
Эргономичная форма - обеспечивает надежность и комфорт;
Защита от хлора - защищает волосы и кожу головы от воздействия хлорированной воды в бассейне;
Безопасность - обеспечивает безопасность во время занятий плаванием, защищая от попадания волос в глаза и под детали очков или купальника.

Линзы с диоптриями - обеспечивают идеальный обзор с широким спектром диоптрий (от -1 до -9);
Прозрачные линзы - чистый и превосходный обзор;
Высокий обтюратор - обеспечивает максимальный комфорт и надежность даже при длительном использовании;
Многоступенчатая носовая перемычка - подходят для любого типа лица;
Покрытие "Антифог Плюс" - усовершенствованная защита от запотевания;
Защита UV - защита от ультрафиолета.

